import React from "react";
import { Link } from "react-router-dom";
import {
  Card,
  Box,
  Image,
  Stack,
  Heading,
  Flex,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

import DarkMode from "./DarkMode";
import { MoreHorizontal } from "react-feather";

const NavBar = () => (

  <Container isFluid paddingX='major-8' paddingY='major-4' margin display='block' position='absolute' zIndex='10'>
    <Columns alignItems="center">
      {/* <Flex alignItems="center" justifyContent="space-between"> */}
        <Columns.Column spread={3} spreadMobile={6}>
          <Link to='/'>
            <Heading use="h4">DAVI</Heading>
          </Link>
        </Columns.Column>

        <Columns.Column spread={2} spreadMobile={3} textAlign="center">
          <DarkMode />
        </Columns.Column>

        <Columns.Column spread={1} spreadMobile={3} textAlign="center">
          <button>
            <MoreHorizontal />
          </button>
        </Columns.Column>
      {/* </Flex> */}
    </Columns>
  </Container>
);

export default NavBar;
